Es un periodo que puede durar un par de semanas, un mes o un par de meses. El objetivo previamente planteado en el macrociclo estaraÌ mejor organizado durante esta etapa. Los tipos de mesociclos que existen son:

El mesociclo de base: estos mesociclos normalmente se utilizan al comienzo de cada periÌodo. Se basan en la creacioÌn de una base fiÌsica sobre la cual se trabaje posteriormente. Aunque este periodo se caracteriza por ser de menor intensidad, tambieÌn lo hace por el gran volumen de trabajo que tendraÌ el deportista.

El mesociclo de desarrollo: en esta fase el deportista experimentaraÌ un aumento en su nivel de rendimiento fiÌsico, asiÌ como en sus capacidades. Al igual que ocurre en el mesociclo de base, el mesociclo de desarrollo seraÌ poco intenso pero con un gran volumen de trabajo.
El mesociclo de estabilizacioÌn o precompeticioÌn: las capacidades fiÌsicas conseguidas en los mesociclos anteriores daraÌn paso a un trabajo enfocado haciÌa otras capacidades maÌs especiÌficas, las cuales precise el deportista para la competicioÌn que vaya a realizar. AquiÌ el volumen de trabajo disminuye, pero aumenta considerablemente la intensidad.

El mesociclo de competicioÌn: tal como su nombre indica, es el trabajo que se realiza durante las competiciones y entre las mismas.

